            __html: '<h2 id="前言">前言<a class="anchor" href="Introduction/Foreword.html#前言">§</a></h2>\n<p>Rocket的设计围绕着三个核心理念：</p>\n<ul>\n<li>\n<p><strong>安全性，正确性和开发人员经验至关重要。</strong></p>\n<p>阻力最小的路径应该引导您找到最安全、最正确的web应用程序，尽管安全性和正确性不应该以降低开发人员体验为代价。Rocket很容易使用，同时采取了很好的措施来确保您的应用程序是安全和正确的，而不会产生认知开销。</p>\n</li>\n<li>\n<p><strong>所有Request请求处理信息都应键入并独立。</strong></p>\n<p>因为Web和HTTP本身是无类型的（或<em>有人称它为字符串</em>类型），所以这意味着某些人必须将字符串转换为本机类型。Rocket用零编程开销为您做到了。而且，Rocket的请求处理是<strong>自包含的</strong>，全局状态为零：处理程序是带有正则参数的正则函数。</p>\n</li>\n<li>\n<p><strong>不应强迫作出决定。</strong></p>\n<p>Templates模板，Serialization序列化，Sessions会话以及几乎所有其他内容都是可插拔的可选组件。尽管Rocket对此都有官方支持和库，但它们是完全可选的和可交换的。</p>\n</li>\n</ul>\n<p>这三个想法决定了Rocket的接口，你会发现所有这些都嵌入到Rocket的核心功能中。</p>'
